import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import ContainerGrid from "./ContainerGrid"; // adjust path as needed
import { mockContainers } from "./mockData"; // adjust path as needed

const Containers = () => {
  return (
    <div className="container my-4">
      {/* Page Header */}
      <div className="mb-4">
        <h2 className="fw-bold mb-1">Container Management</h2>
        <p className="text-muted">
          Manage all your containers and slots efficiently
        </p>
      </div>

      {/* Container List */}
      <div className="d-flex flex-column gap-4">
        {mockContainers.map((container) => (
          <ContainerGrid key={container.id} container={container} />
        ))}
      </div>
    </div>
  );
};

export default Containers;
